        require(!initialized, "BaseMock: already initialized");
        initialized = true;
        emit MockInitialized(msg.sender);
    }

    /**
     * @dev Reset mock state for testing
     */
    function reset() external onlyRole(DEFAULT_ADMIN_ROLE) {
        initialized = false;
        lastCaller = address(0);
