        _recordFunctionCall(
            "setPrice",
            abi.encode(_price)
        );

        price = _price;
        timestamp = block.timestamp;
        roundId++;

        emit PriceUpdated(price, timestamp, roundId);
    }

    /**
     * @dev Set the timestamp
     * @param _timestamp New timestamp value
     */
    function setTimestamp(uint256 _timestamp) external {
        _recordFunctionCall(
            "setTimestamp",
            abi.encode(_timestamp)
        );

